import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
//import logo from './logo.svg';
import './App.css';
import Row from './Components/Row.js';
import Col from './Components/Col.js';
import Button from './Components/Button.js';
import Table from './Components/Table.js';
import Map from './Components/Map.js';
import Icon from './Components/Icon.js';
import SearchForm from './Components/SearchForm.js';
import HostForm1 from './Components/HostForm1.js';
import HostForm2 from './Components/HostForm2.js';
import HostForm3 from './Components/HostForm3.js';
import HostForm4 from './Components/HostForm4.js';
import MainNav from './Components/MainNav.js';
import { BrowserRouter, Route, NavLink } from 'react-router-dom';

// import Main from './Main.js';
// import PracticeNewPage from './Components/PracticeNewPage.js';
// import {
//   Route,
//   NavLink,
//   HashRouter
// } from "react-router-dom";
class App extends Component{

    render() {

      const hosts = [
  			{
  				firstName: 'Scott',
  				lastName: 'McConnell',
  				street: '1262 Farm Rd',
  				city: 'Berwyn',
  				state: 'Pennsylvania',
  				zip: '19312',
  				email: 'skm44@duke.edu',
  				phone: '6103124662',
  				spaceType: 'Garage',
  				spaceAvailable: '160',
  				createdAt: new Date()
  			},
  			{
  				firstName: 'Josh',
  				lastName: 'France',
  				street: '220 Alexander Ave',
  				city: 'Durham',
  				state: 'North Carolina',
  				zip: '27705',
  				email: 'jrf36@duke.edu',
  				phone: '9802146075',
  				spaceType: 'Shed',
  				spaceAvailable: '100',
  				createdAt: new Date(),
  			},
  			{
  				firstName: 'Samir',
  				lastName: 'Agadi',
  				street: '207 Erwin Rd',
  				city: 'Durham',
  				state: 'North Carolina',
  				zip: '27705',
  				email: 'sa280@duke.edu',
  				phone: '2486335250',
  				spaceType: 'Closet',
  				spaceAvailable: '50',
  				createdAt: new Date(),
  			},
  		];



    return (

      <div className="Main">
        <header className="Main-header">
          <MainNav/>
        </header>

        <div className ="Main-content">
          <Table dataPoints={hosts} colSpacing="col-md-6"/>
          <Map colSpacing = "col-md-6"/>
        </div>
      </div>


    );
  }

}
export default App;
